import React, { useState } from "react";


const App = () => {

const [name,setname] = useState();


return(
    <>
    <div className="container">
    <h1 className="head">Hello {name}</h1>
        <form>
            <input placeholder="Enter Your Firstname" className="fname"></input>
            <input placeholder="Enter Your Lastname" className="lname"></input>
        </form>
            <button className="btn"> Submit Now</button>
    </div>
    </>
)
}


export default App;
